  "id_str" : "928675048671543301",
  "text" : "A3 (cont.) for a lot of companies who use to on-premise this is a big mindset change as use to having servers running 24\/7. while in the cloud you can have a server up for 15 seconds and then shutdown and only pay for the time it up and nothing else. #cloudchat.",
